    false,nt"url": null,nt"notes": "This Fire Management Plan for Missisquoi
    National Wildlife Refuge was developed to provide direction and continuity in operational
    procedures to guide all fire program activities. The following considerations were
    used to develop the fire management goals and objectives for Missisquoi National
    Wildlife Refuge: 1) Fire is an essential option for maintaining the refuge's native
    biotic communities. 2) Prescribed fire has positive effects on vegetation, wildlife,
    and cultural resources when the appropriate burning conditions, techniques, and
    principles of plant phenology are considered. 3) Uncontrolled wildfire has the potential
    for negative impacts (out of season, wind events, fire trespass, burning onto neighboring
    properties). 4) "Light hand on the land" or minimum impact suppression tactics
    should be implemented to minimize environmental damage or damage to cultural resources.",nt"license_title":
